<p>Als directie-assistent is Anne de spin in het web, rechterhand van Jo, en onmisbare schakel tussen collega&#8217;s en directie. Ze vindt het mooi en uitdagend om allround oplossingen te kunnen bieden en zo bij te dragen aan het succes van Cultuur+Ondernemen. Geen Schoevers voor Anne, maar Oost-Europese studies en Tsjechisch aan de UvA en via de Nederlandse ambassade in Praag, waar ze als secretaresse van de ambassadeur heeft gewerkt, het vak niet meer verlaten. Hiervoor heeft ze bij een grote zorgorganisatie gewerkt en bij Theater Instituut Nederland. Haar passie voor Praag is nog steeds groot, evenals haar passie voor theater en dwarsfluit (ze speelt onder andere samen met een klavecinist).</p><?php }} ?>
